// import "//dapi.kakao.com/v2/maps/sdk.js?autoload=false&appkey=915cffed372954b7b44804ed422b9cf0&libraries=services,clusterer&autoload=false";

export const getAddressCoordinates = async (kakaoMap, addr) => {
    const geocoder = new kakao.Map.maps.services.Geocoder();

    console.log("여기까진 멀쩡해!");
    await geocoder.addressSearch(addr, (res, stat) => {
        if (stat === kakao.Map.maps.service.Status.OK) {
            console.log("나와라 좌표!");
            const result = new kakao.Map.maps.LatLng(res[0].x, res[0].y);
            return result;
        } else {
            alert(
                "ERROR: UNKNOWN EXCEPTION.\n"+
                "to [services.Geocoder]\n"+
                "from '/api/geocoder.js'"
            );
            return null;
        }
    });
}
